// Replace entire ContractInput.js with this

// Import React, but don't import any CSS files
import React, { useState, useEffect } from 'react';

// Define our own component from scratch
const ContractInput = ({ onContractChange, initialContract = '' }) => {
  // State variables
  const [level, setLevel] = useState('');
  const [suit, setSuit] = useState('');
  const [declarer, setDeclarer] = useState('');
  const [doubled, setDoubled] = useState(undefined); // undefined to ensure no default
  
  // Parse initial contract if provided
  useEffect(() => {
    if (initialContract) {
      const contractMatch = initialContract.match(/(\d)([♣♦♥♠]|NT)\s+([NESW])(X{0,2})/);
      if (contractMatch) {
        setLevel(contractMatch[1]);
        setSuit(contractMatch[2]);
        setDeclarer(contractMatch[3]);
        setDoubled(contractMatch[4] || undefined);
      }
    }
  }, [initialContract]);
  
  // Update contract when components change
  useEffect(() => {
    if (level && suit && declarer) {
      const doubledPart = doubled !== undefined ? doubled : '';
      const newContract = `${level}${suit} ${declarer}${doubledPart}`;
      onContractChange(newContract);
    }
  }, [level, suit, declarer, doubled, onContractChange]);
  
  // Common button style
  const buttonStyle = {
    flex: 1,
    height: '50px',
    border: '1px solid #ddd',
    borderRadius: '8px',
    fontSize: '18px',
    fontWeight: 'bold',
    cursor: 'pointer',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: '#f8f8f8',
    color: 'black',
    margin: '2px'
  };
  
  // Selected button style
  const selectedStyle = {
    backgroundColor: '#3498db',
    color: 'white',
    border: '1px solid #3498db'
  };
  
  // Component container style
  const containerStyle = {
    display: 'flex',
    flexDirection: 'column',
    gap: '10px',
    padding: '5px'
  };
  
  // Section style
  const sectionStyle = {
    marginBottom: '10px'
  };
  
  // Label style
  const labelStyle = {
    fontWeight: 'bold',
    marginBottom: '5px',
    fontSize: '14px',
    color: '#1e5c8b'
  };
  
  // Row style
  const rowStyle = {
    display: 'flex',
    gap: '5px',
    marginBottom: '5px'
  };
  
  // Function to get button style based on selection
  const getButtonStyle = (value, currentValue) => {
    return value === currentValue ? 
      { ...buttonStyle, ...selectedStyle } : 
      buttonStyle;
  };
  
  // Render component
  return (
    <div style={containerStyle}>
      {/* Level and Suit Section */}
      <div style={sectionStyle}>
        <div style={labelStyle}>Level and Suit:</div>
        
        {/* Level buttons */}
        <div style={rowStyle}>
          {[1, 2, 3, 4, 5, 6, 7].map(num => (
            <div
              key={`level-${num}`}
              style={getButtonStyle(num.toString(), level)}
              onClick={() => setLevel(num.toString())}
            >
              {num}
            </div>
          ))}
        </div>
        
        {/* Suit buttons */}
        <div style={rowStyle}>
          <div
            style={{
              ...getButtonStyle('♣', suit),
              color: suit === '♣' ? 'white' : 'black',
              fontSize: '24px'
            }}
            onClick={() => setSuit('♣')}
          >
            ♣
          </div>
          <div
            style={{
              ...getButtonStyle('♦', suit),
              color: suit === '♦' ? 'white' : '#e74c3c',
              fontSize: '24px'
            }}
            onClick={() => setSuit('♦')}
          >
            ♦
          </div>
          <div
            style={{
              ...getButtonStyle('♥', suit),
              color: suit === '♥' ? 'white' : '#e74c3c',
              fontSize: '24px'
            }}
            onClick={() => setSuit('♥')}
          >
            ♥
          </div>
          <div
            style={{
              ...getButtonStyle('♠', suit),
              color: suit === '♠' ? 'white' : 'black',
              fontSize: '24px'
            }}
            onClick={() => setSuit('♠')}
          >
            ♠
          </div>
          <div
            style={getButtonStyle('NT', suit)}
            onClick={() => setSuit('NT')}
          >
            NT
          </div>
        </div>
      </div>
      
      {/* Declarer Section */}
      <div style={sectionStyle}>
        <div style={labelStyle}>Declarer:</div>
        <div style={rowStyle}>
          {['N', 'S', 'E', 'W'].map(d => (
            <div
              key={`declarer-${d}`}
              style={getButtonStyle(d, declarer)}
              onClick={() => setDeclarer(d)}
            >
              {d}
            </div>
          ))}
        </div>
      </div>
      
      {/* Doubled Section */}
      <div style={sectionStyle}>
        <div style={labelStyle}>Doubled:</div>
        <div style={rowStyle}>
          <div
            style={getButtonStyle('', doubled)}
            onClick={() => setDoubled('')}
          >
            -
          </div>
          <div
            style={getButtonStyle('X', doubled)}
            onClick={() => setDoubled('X')}
          >
            X
          </div>
          <div
            style={getButtonStyle('XX', doubled)}
            onClick={() => setDoubled('XX')}
          >
            XX
          </div>
        </div>
      </div>
      
      {/* Debug values (set display to 'block' to see them) */}
      <div style={{ display: 'none', padding: '5px', backgroundColor: '#f5f5f5', fontSize: '12px' }}>
        Level: {level}, Suit: {suit}, Declarer: {declarer}, Doubled: {doubled === undefined ? 'undefined' : doubled}
      </div>
    </div>
  );
};

export default ContractInput;
